import React from "react";

const HeroText = () => {
  return (
    <>
      <div className="bg-black flex flex-col items-center justify-center text-center h-screen">
        <h1 className="text-white text-4xl md:text-6xl font-bold">
          Make AI work for{" "}
          <span className="text-transparent bg-clip-text bg-gradient-to-r from-pink-500 to-blue-500">
            your brand
          </span>
        </h1>
        <h2 className="text-white text-2xl md:text-4xl font-medium mt-4">
          From Today
        </h2>
      </div>
      <div className="bg-black flex justify-center items-center h-screen">
        <button className="relative bg-black text-white text-lg font-semibold py-3 px-8 rounded-full border border-gray-700 shadow-md hover:shadow-lg transition">
          Join Waitlist
          <span className="absolute inset-x-0 bottom-0 h-2 bg-gradient-to-r from-purple-500 to-pink-500 rounded-full opacity-50 blur-md"></span>
        </button>
      </div>
    </>
  );
};

export default HeroText;
